\begin{align*}
AD^2 + OD^2 &= OA^2 \\
15^2 + r^2 &= (2r)^2 \\
225 + r^2 &= 4r^2 \\
225 &= 3r^2 \\
75 &= r^2 \\
r &= \sqrt{75} \\
r &= \frac{15\sqrt{3}}{3} \\
r &= \boxed{\frac{15\sqrt{3}}{3}}.
\end{align*}The answer is: \frac{15\sqrt{3}}{3}

